style.css:
@-moz-document domain("youtube.com"), regexp("http(s?)://[^/]*\.youtube(\.com)?(\.[a-z][a-z])?/.*"), regexp("http(s?)://youtube(\.com)?(\.[a-z][a-z])?/.*") {
.ytd-rich-grid-renderer {   width: 490px; }
#contents.ytd-rich-grid-row { width:  450px;}
#video-title.ytd-rich-grid-media {      font-size: 1.1rem; }
#channel-name.ytd-video-meta-block { max-width: 112%; }
#text.complex-string.ytd-channel-name { font-size: 1.1rem; }
span.ytd-video-meta-block { font-size: 1.0rem }
#meta.ytd-rich-grid-media { overflow-x: hidden;  padding-right: 1px; }
ytd-rich-section-renderer.style-scope > .ytd-shelf-renderer.style-scope {
    display: none;
}
ytd-rich-section-renderer.ytd-rich-grid-renderer.style-scope > .ytd-rich-section-renderer.style-scope{
    display: none;
}
ytd-rich-section-renderer.ytd-rich-grid-renderer.style-scope{
    display: none;
}
ytd-rich-item-renderer.ytd-rich-grid-row{
    width: 150px;
}
#chips-wrapper.ytd-feed-filter-chip-bar-renderer {
    display: none;
}
ytd-video-owner-renderer[watch-metadata-refresh] #upload-info.ytd-video-owner-renderer {
    margin-right: 4px;
  }
#contents.ytd-rich-grid-renderer {
  justify-content: space-evenly; 
	margin-left: -95px;
 
}
}
